void node1_matmul_f32(const float a[1][256], const float b[256][286], float out[1][286]) {
        for (int64_t i = 0; i < 1; ++i) {
            for (int64_t j = 0; j < 286; ++j) {
                float acc = 0.0f;
                for (int64_t t = 0; t < 256; ++t) {
                    acc += a[i][t] * b[t][j];
                }
                out[i][j] = acc;
            }
        }
}

void node2_add_f32(const float a[1][286], const float b[286], float out[1][286]) {
    for (int64_t i0 = 0; i0 < 1; ++i0) {
        for (int64_t i1 = 0; i1 < 286; ++i1) {
            out[i0][i1] = ref_scalar_f32_add(a[0][i1], b[i1]);
        }
    }
}

